import { Dispatch, SetStateAction } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import { Station_new } from "./types";
import heart from "./media/heart.png"
import lungs from "./media/lungs.png";

type OSCEHomeProps = {
    availableStations: Station_new[];
    updateStation: Dispatch<SetStateAction<Station_new>>;
}

const HomePage = (props: OSCEHomeProps) => {

    return (
        <div >
            <div style = {{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
                <LogoTitle> <Link to = "/"> <h1>MedBakery</h1></Link> </LogoTitle> 
                <SignUpButton>Sign up</SignUpButton>
            </div>

            <div style = {{ borderBottom: "0.5px solid grey" }}>
                <div style = {{ display: "flex", marginLeft: "5%" }}>
                    <Option style = {{ backgroundColor: "#2f3237", color: "#FAD000" }}> OSCE    </Option>
                    <Option style = {{ textDecoration: "line-through" }}> MedBook </Option>
                    <Option style = {{ textDecoration: "line-through" }}> QBank   </Option>
                    <Option style = {{ textDecoration: "line-through" }}> Anatomy </Option>
                </div>
            </div>

            <div style = {{ background: "#2f3237", margin: "5%", padding: "5%" }} >

                <h4>Try out our demo stations!</h4>

                <br/>

                {
                    props.availableStations.map((s, i) => 
                        <>
                            <Link to = "/OSCE/Station">
                                <StationPanel onClick = { () => props.updateStation(s) }>
                                    <div style = {{ margin: "20px" }}><img src = { lungs } width = "60pc"/></div>
                                    <div style = {{ padding: "5px" }}><h5>{ s.title }</h5></div>
                                </StationPanel>
                            </Link>
                            <br/>
                        </>
                    )
                }

            </div>


        </div>
    )
}

export default HomePage;

const LogoTitle = styled.div`
    margin: 30px 5%;
`

const SignUpButton = styled.div`
    text-align: center;
    margin: 30px 10%;
    border-radius: 25px;
    width: 150px;
    height: 30px;
    border: 2px solid grey;
    color: #FAD000;
`

const StationPanel = styled.button`
    display: flex;
    align-items: center;
    background-color: #1C2124;
    color: white;
    border-style: none;
    border-radius: 5px;
    width: 100%;
    max-width: 500px;
`

const StartButton = styled.div`
    text-align: center;
    margin: 20px auto;
    border-radius: 25px;
    width: 150px;
    height: 30px;
    border: 2px solid grey;
    color: #FAD000;
`

const Option = styled.div`
    padding: 15px;
`
